contract NFTAdValorem is ERC721URIStorage, Ownable {
    using Counters for Counters.Counter;
    Counters.Counter private _tokenIds;

    event TokenCreated(uint256 tokenId, string uri, address creator);
    event TokenBurned(uint256 tokenId, address burner);

    // TODO: can be made to support multi marketplace
    constructor() ERC721("AdValorem Market NFT", "AdVNFT") {}

    function createToken(string memory tokenURI) public returns (uint256) {
        _tokenIds.increment();
        uint256 tokenId = _tokenIds.current();
        _safeMint(msg.sender, tokenId, "");
        _setTokenURI(tokenId, tokenURI);

        emit TokenCreated(tokenId, tokenURI, msg.sender);
        return tokenId;
    }

    function createMultiToken(string[] memory tokenURIs) public {
        for (uint256 i = 0; i < tokenURIs.length; i++) {
            createToken(tokenURIs[i]);
        }
    }

    function burn(uint256 tokenId) public returns (uint256) {
        _burn(tokenId);

        emit TokenBurned(tokenId, msg.sender);

        return tokenId;
    }
}
